On behalf of the Vendor, CBRE has the exclusive pleasure to offer 86 Brookes Street, Fortitude Valley For Sale via Expression of Interest closing 4pm (AEST) Wednesday, 25 March, 2015.

The property presents a fantastic opportunity to acquire a fully leased asset in one of Australia's most established commercial precincts.

We summarise the key characteristics of this investment opportunity as follows:

- 100% occupied with a brand new seven (7) year lease;
- Net annual return $396,149pa*;
- Twelve (12) month bank guarantee providing certainty of cash flow;
- Fully refurbished boutique serviced office facility with 972 sqm* of net lettable area ;
- On-site parking for twelve (12) cars;
-  Situated in Australia's fastest growing office market and Brisbane's foremost cultural, lifestyle, and entertainment precinct; and
- Opportunity to secure a long term income stream in the lowest interest rate climate in history

For further information regarding this outstanding investment opportunity, please contact the exclusive marketing agents listed below.
